import Mock from 'mockjs'

function repeat(size, template) {
  let data = [];
  for (let i = 0; i < size; i++) {
    data.push(template)
  }
  return data;
}

Mock.mock(
  '/test', repeat(10, {
    'id|+1': 1,
    'data': '@name',
  })
);
